public class ConsignmentDraftReplenishmentOrderJournal extends FormRun implements IDialogable, InventDimICtrl_Frm
{
    private ConsignmentDraftReplenishmentOrderJournalForm draftReplenishmentOrderJournalForm;
    private InventDimCtrl_Frm_Mov inventDimFormSetup;
    private ConsignmentReplenishmentOrderFormLetter replenishmentOrderFormLetter;
    private DocumentStatus documentStatus;

}

public FormRun formRun()
{
    //Required by the SysOperation framework.
    return this;
}

void  init()
{
    super();

    if (!element.args().caller())
    {
         throw error("@SYS22539");
    }

    replenishmentOrderFormLetter = element.args().caller();
    documentStatus = replenishmentOrderFormLetter.documentStatus();
    ParmId parmId = replenishmentOrderFormLetter.parmId();

    draftReplenishmentOrderJournalForm = ConsignmentDraftReplenishmentOrderJournalForm::construct(documentStatus);

    consignmentDraftReplenishmentOrderJournalHeader_ds.query()
        .dataSourceTable(tableNum(ConsignmentDraftReplenishmentOrderJournalHeader))
        .addRange(fieldNum(ConsignmentDraftReplenishmentOrderJournalHeader, ParmId)).value(queryValue(parmId));

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

public void updateDesign(InventDimFormDesignUpdate mode)
{
    InventMovement movement = InventMovement::construct(consignmentDraftReplenishmentOrderJournalLine.replenishmentOrderLine());

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_Mov_Parm::newFromFormMovement(element, movement, false);
            }
            // fall through

        case InventDimFormDesignUpdate::Active,
            InventDimFormDesignUpdate::FieldChange:
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(),movement);
            inventDimFormSetup.formSetControls(mode == InventDimFormDesignUpdate::Active);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

private void enableConsignmentDraftReplenishmentOrderJournalLineActions()
{
    InventTable item            = InventTable::find(consignmentDraftReplenishmentOrderJournalLine.ItemId);
    boolean isBatchSpecified    = inventDim.InventBatchId != '';
    boolean isShelfLife         = item.isShelfLifeItem();
    boolean isItemBatchEnabled  = item.isItemBatchActivated();

    PdsInventBatch.enabled(isShelfLife && isBatchSpecified);
    PdsResetDispositionStatus.enabled(isItemBatchEnabled && isBatchSpecified);

    if (#PdsBatchAttribEnabled)
    {
        PdsBatchAttributes.visible(isItemBatchEnabled && isBatchSpecified);
        PdsBatchAttributesInput.visible(isItemBatchEnabled && !isBatchSpecified);
    }
}

private void enableConsignmentDraftReplenishmentOrderJournalLineFields()
{
    if (#PdsShelfEnabled)
    {
        boolean enable = documentStatus == DocumentStatus::PackingSlip;

        ConsignmentDraftReplenishmentOrderJournalLine_PdsDispositionCode.allowEdit(enable);
        ConsignmentDraftReplenishmentOrderJournalLine_PdsDispositionStatus.allowEdit(enable);
    }

    if (#PdsVendBatchEnabled)
    {
        var canSetVendorBatchInfo = consignmentDraftReplenishmentOrderJournalLine.canSetVendorBatchInfo();

        ConsignmentDraftReplenishmentOrderJournalLine_ds.object(fieldNum(ConsignmentDraftReplenishmentOrderJournalLine, PdsCountryOfOrigin1)).allowEdit(canSetVendorBatchInfo);
        ConsignmentDraftReplenishmentOrderJournalLine_ds.object(fieldNum(ConsignmentDraftReplenishmentOrderJournalLine, PdsCountryOfOrigin2)).allowEdit(canSetVendorBatchInfo);
        ConsignmentDraftReplenishmentOrderJournalLine_ds.object(fieldNum(ConsignmentDraftReplenishmentOrderJournalLine, PdsVendBatchId)).allowEdit(canSetVendorBatchInfo);
        ConsignmentDraftReplenishmentOrderJournalLine_ds.object(fieldNum(ConsignmentDraftReplenishmentOrderJournalLine, PdsVendBatchDate)).allowEdit(canSetVendorBatchInfo);
        ConsignmentDraftReplenishmentOrderJournalLine_ds.object(fieldNum(ConsignmentDraftReplenishmentOrderJournalLine, PdsVendExpiryDate)).allowEdit(canSetVendorBatchInfo);
    }
}

public int active()
{
    int ret;

    ret = super();

    this.enableConsignmentDraftReplenishmentOrderJournalLineFields();
    this.enableConsignmentDraftReplenishmentOrderJournalLineActions();

    return ret;
}

